INSERT INTO `tbl_fasilitas` VALUES (2, 1, '<p><strong>Pulau Pari 2 Hari 1 Malam</strong></p>\r\n\r\n<hr />\r\n<p><strong>Tempat Yang Dikunjungi</strong></p>\r\n\r\n<ul>\r\n	<li>Pantai Pasir Perawan</li>\r\n	<li>Pantai Bintang Rama</li>\r\n	<li>Bukit Matahari</li>\r\n	<li>LIPI (Penelitian Biota Laut)</li>\r\n	<li>Pantai Kresek</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Fasilitas</strong></p>\r\n\r\n<ul>\r\n	<li>Tiket return Ferry Pel.Kali Adem &ndash; Pulau Pari (via Kaliadem)</li>\r\n	<li>Tiket return Speed Boat &ndash; Pulau Pari (via Dermaga 16 Marina)</li>\r\n	<li>Asuransi (Jasaraharja)</li>\r\n	<li>Homestay full AC (Share Room)</li>\r\n	<li>Dispenser (@homestay)</li>\r\n	<li>TV (@homestay)</li>\r\n	<li>Welcome Drink</li>\r\n	<li>Makan 3x (2D1N)</li>\r\n	<li>Barbeque (1x)</li>\r\n	<li>Life Jacket selama perjalanan</li>\r\n	<li>Kotak P3K</li>\r\n	<li>Kapal Snorkeling dan Jelajah Pulau</li>\r\n	<li>Sepeda untuk berkeliling di Pulau Pari</li>\r\n	<li>Alat Snorkeling</li>\r\n	<li>Tiket wisata seluruh destinasi</li>\r\n	<li>Local Guide Pulau Pari</li>\r\n	<li>Dokumentasi foto &amp; underwater</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Tidak Termasuk</strong></p>\r\n\r\n<ul>\r\n	<li>Biaya pengeluran pribadi di luar paket (include)</li>\r\n	<li>Biaya perjalanan menuju meeting point</li>\r\n	<li>Tipping Guide (seikhlasnya)</li>\r\n	<li>Biaya water sport</li>\r\n	<li>Upgrade/tambah kamar homestay</li>\r\n</ul>\r\n\r\n<hr />\r\n<p><strong>Saran Perlengkapan</strong></p>\r\n\r\n<ul>\r\n	<li>Peralatan snorkeling (jika punya)</li>\r\n	<li>Baju ganti</li>\r\n	<li>Baju renang</li>\r\n	<li>Sandal yang nyaman</li>\r\n	<li>Obat-obatan pribadi dan peralatan mandi</li>\r\n	<li>Topi dan kacamata hitam</li>\r\n</ul>\r\n');
INSERT INTO `tbl_itenerary` VALUES (9, 5, '<p>okokoko</p>\r\n');
INSERT INTO `tbl_itenerary` VALUES (10, 1, '<p>Itenerary Pertama</p>\r\n\r\n<hr />\r\n<p><strong>Hari 1</strong></p>\r\n\r\n<p>06.30 &ndash; 07.30 : Kumpul di meeting point + regitrasi ulang + naik kapal<br />\r\n08.00 : Start perjalanan menuju Pulau Pari<br />\r\n10.00 : Tiba di Pulau Pari<br />\r\n10.15 : Check In Homestay dan istirahat<br />\r\n10.30 : Bersepeda di sekitar Pulau Pari (explore)<br />\r\n11.30 : Istirahat makan siang<br />\r\n13.00 : Start perjalanan menuju Spot Snorkeling<br />\r\n13.30 : Start kegiatan Snorkeling<br />\r\n16.30 : Hunting foto sunset di LIPI Pulau Pari<br />\r\n17.45 : Kembali ke Homestay dan mandi<br />\r\n19.00 : Makan malam<br />\r\n20.30 : Acara barbeque<br />\r\n22.30 : Acara bebas dan istirahat malam</p>\r\n\r\n<hr />\r\n<p><strong>Hari 2</strong></p>\r\n\r\n<p>05.00 &ndash; 07.00&nbsp; Sunrise di Dermaga Pulau Pari (optional)<br />\r\n07.00 &ndash; 08.00&nbsp; Sarapan.<br />\r\n08.00 &ndash; 09.30&nbsp; Acara bebas atau bisa bersepeda ke Pantai Pasir Perawaan.<br />\r\n09.30 &ndash; 10.00&nbsp; Kembali ke Homestay dan packing barang.<br />\r\n10.00 &ndash; 10.15&nbsp; Check Out dari Homestay.<br />\r\n10.15 &ndash; 10.30&nbsp; Standby di Dermaga Pulau Pari dan naik ke Kapal.<br />\r\n10.30 &ndash; 12.30&nbsp; Start perjalanan menuju Kaliadem.<br />\r\n12.30 &ndash; 12.40&nbsp; Tiba di Pelabuhan Kaliadem.<br />\r\n12.40 &ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Finish Trip and See You next Trip.</p>\r\n\r\n<hr />\r\n<p><strong><em>NB: Itinerary bersifat fleksibel (tidak baku).&nbsp;</em><em>Menyesuaikan situasi cuaca, alam dan lalu lintas.</em></strong></p>\r\n\r\n<hr />\r\n<p>Itinerary via Marina Ancol</p>\r\n\r\n<hr />\r\n<p>Hari 1</p>\r\n\r\n<p>06.30 &ndash; 07.30&nbsp; Kumpul di meeting point + regitrasi ulang + naik kapal.<br />\r\n08.00 &ndash; 09.00&nbsp; Start perjalanan menuju Pulau Pari.<br />\r\n09.00 &ndash; 09.15&nbsp; Tiba di Pulau Pari.<br />\r\n09.15 &ndash; 09.30&nbsp; Check In Homestay.<br />\r\n09.30 &ndash; 11.30&nbsp; Bersepeda di sekitar Pulau Pari (explore).<br />\r\n11.30 &ndash; 13.00&nbsp; Istirahat makan siang.<br />\r\n13.00 &ndash; 13.30&nbsp; Start perjalanan menuju Spot Snorkeling.<br />\r\n13.30 &ndash; 16.30&nbsp; Start kegiatan Snorkeling.<br />\r\n16.30 &ndash; 17.45&nbsp; Hunting foto sunset di LIPI Pulau Pari.<br />\r\n17.45 &ndash; 19.00&nbsp; Kembali ke Homestay dan mandi.<br />\r\n19.00 &ndash; 20.30&nbsp; Makan malam.<br />\r\n20.30 &ndash; 22.30&nbsp; Acara barbeque.<br />\r\n22.30 &ndash; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Acara bebas dan istirahat malam.</p>\r\n\r\n<hr />\r\n<p><strong>Hari 2</strong></p>\r\n\r\n<p>05.00 &ndash; 07.00&nbsp; Sunrise di Dermaga Pulau Pari (optional)<br />\r\n07.00 &ndash; 09.00&nbsp; Sarapan.<br />\r\n09.00 &ndash; 11.00&nbsp; Acara bebas atau bisa bersepeda ke Pantai Pasir Perawaan.<br />\r\n11.00 &ndash; 11.15&nbsp; Kembali ke Homestay dan packing barang.<br />\r\n11.15 &ndash; 11.30&nbsp; Check Out dari Homestay.<br />\r\n11.30 &ndash; 12.00&nbsp; Standby di Dermaga Pulau Pari dan naik ke Kapal.<br />\r\n12.00 &ndash; 13.00&nbsp; Start perjalanan menuju Marina Ancol.<br />\r\n13.00 &ndash; 13.10&nbsp; Tiba di Dermaga Marina Ancol.<br />\r\n13.10 &ndash;&nbsp; end&nbsp; &nbsp; Finish Trip and See You next Trip.</p>\r\n\r\n<hr />\r\n<p><strong><em>NB: Itinerary bersifat fleksibel (tidak baku)&nbsp;</em><em>Menyesuaikan situasi cuaca, alam dan lalu lintas.</em></strong></p>\r\n');
